public ExportToExcelDataEntityContext getDataEntityContext(OfficeGeneratedExportMenuItem _menuItem)
{
    ExportToExcelDataEntityContext context = null;

    if (_menuItem.id() == CustomExportLinesToExcelOptionId)
    {
        context = ExportToExcelDataEntityContext::construct(tableStr(InventInventoryTagCountingJournalLineEntity), tableFieldGroupStr(InventInventoryTagCountingJournalLineEntity, AutoReport));

        ListEnumerator enumerator = context.entities().getEnumerator();
        while (enumerator.moveNext())
        {
            ExportToExcelDataEntityInfo entity = enumerator.current();

            if (entity.entityName() == tableStr(InventInventoryTagCountingJournalLineEntity))
            {
                ExportToExcelFilterTreeBuilder filterBuilder = new ExportToExcelFilterTreeBuilder(tablestr(InventInventoryTagCountingJournalLineEntity));

                var filter = filterBuilder.and(
                    filterBuilder.areEqual(fieldStr(InventInventoryTagCountingJournalLineEntity, DataAreaId), curExt()),
                    filterBuilder.areEqual(fieldStr(InventInventoryTagCountingJournalLineEntity, JournalNumber), InventJournalTable.JournalId));

                entity.filter(filter);
            }
        }
    }

    return context;
}

void init()
{
    xArgs args = this.args();

    // default journal type to ensure query durable between caller.
    if (args && !args.parmEnumType())
    {
        args.parmEnumType(enumNum(InventJournalType));
        args.parmEnum(enum2int(InventJournalType::TagCounting));
    }

    PdsCWFormCtrl   cwFormCtrl;

    journalFormTrans = new InventJournalFormTrans_TagCount(element);
    journalFormTable = new InventJournalFormTable(element);
    journalFormTrans.parmJournalFormTable(journalFormTable);

    if (#PdsCatchWeightEnabled)
    {
        cwFormCtrl = PdsCWFormCtrl::constructFromForm(element);

        cwFormCtrl.parmFieldIds(PdsCWValidation::fieldMapFromContainers(
            [[fieldNum(InventJournalTrans_Tag,Qty), fieldNum(InventJournalTrans_Tag,PdsCWQty), true, fieldNum(InventJournalTrans_Tag,UnitID)]]
        ));
        cwFormCtrl.parmItemFieldId(fieldNum(InventJournalTrans_Tag,ItemId));
        cwFormCtrl.parmUnitMethodStr(tableMethodStr(InventJournalTrans_Tag,pdsCWUnitId));

        journalFormTrans.parmCWFormCtrl(cwFormCtrl);
    }

    super();

    journalFormTrans.parmCtrlLineLogImage(lineLogImage);

    inventDimParmAllowCreate = true;

    journalFormTable.parmCtrlJournalTypeGrid(ctrlGridJournalType1);
    journalFormTable.parmCtrlJournalIdGrid(ctrlGridJournalId1);
    journalFormTable.parmCtrlCopyJournal(inventJournalCopy);
    journalFormTable.parmCtrlReports_RU(printMenu);
    journalFormTable.parmCtrlCheckJournal(checkJournal);
    journalFormTable.parmCtrlPostJournal(postJournal);
    journalFormTable.parmCtrlInfolog(showInfoLog);
    journalFormTable.parmCtrlMarkUserBlock(markUserBlock);
    journalFormTable.parmCtrlMarkInUseBlock(markInUseBlock);
    journalFormTable.parmCtrlSystemBlocked(systemBlocked);
    journalFormTable.parmCtrlBlockImage(blockImage);
    journalFormTable.parmCtrlInitTotals(initTotals);

    journalFormTable.formInitPost();
    journalFormTrans.registerEventHandlersOnInventDimDataSource();

    this.initOrigWorkflowRelatedControllerStatus();
}

